 /*
* 日夜切换
*/
var html = document.querySelector('html'),
darkLight = document.querySelector('.dark-light')
darkLight.addEventListener('click', function(){
   if(html.getAttribute('data-theme') === 'light'){
       html.setAttribute('data-theme', 'dark')
       localStorage.setItem('selected-theme', 'dark');
   }else{
       html.setAttribute('data-theme', 'light')
       localStorage.setItem('selected-theme', 'light');
   }
})


/*

*/
$(document).ready(function () {
    'use strict'
    

    // 手机菜单
    $('#nav').clone().prependTo('.mobile-menu')

    // 关联操作
    $('.bar-icon, .menu-close').on('click', function (e) {
        e.stopPropagation()
        $('.bar-icon').toggleClass('active-bar')
        $('.mobile-menu-wrapper').toggleClass('active-menu')
        $('body, .header-area').toggleClass('show-mobile-menu')
    })
    $('.mobile-menu-wrapper').on('click', function (e) {
        e.stopPropagation()
    })

    function mobileMenu() {
        $('.bar-icon').removeClass('active-bar')
        $('.mobile-menu-wrapper').removeClass('active-menu')
        $('body, .header-area').removeClass('show-mobile-menu')
    }

    $(document).on('click', function () {
        mobileMenu()
    })



    // fitVids js
    $('body').fitVids()

    // isotope
    var $grid = $('.blog-post-masonary-card').imagesLoaded(function () {
        $grid.isotope({
            itemSelector: '.single-blog-post-card',
            percentPosition: true,
            masonry: {
                columnWidth: '.single-blog-post-card',
            },
        })
    })

    // 代码高亮复制
    $('.copy-link').on('click', function(e){
        e.preventDefault()
        var url = $(this).data('link')

        var $temp = $("<input>");
        $("body").append($temp);
        $temp.val(url).select();
        document.execCommand("copy");
        $temp.remove();
        $('.copied').fadeIn()

        setTimeout(function(){
            $('.copied').fadeOut()
        }, 1000)
    })
    
    // Fslider
    $('.featured-slider').owlCarousel({
        items: 1,
        autoplay: true,
        loop: true,
        nav: false,
        dots: true,
        smartSpeed: 900,
        responsiveClass: true,
        autoHeight:true,
        animateOut: 'fadeOut',
    })

    var i = 1
    $('.featured-slider .owl-dot').each(function () {
        if (i < 10) $(this).text(i)
        else $(this).text(i)
        i++
    })

    /******************************************
     * 登录注册
     */
    $('.signin-popup').on('click', function (e) {
        e.preventDefault()
        mobileMenu()
        setTimeout(function () {
            $('#signup').removeClass('show')
            $('#signin').addClass('show')
        }, 300)
    })
    $('.close-modal').on('click', function () {
        $('.authentication-content').removeClass('show')
    })
    $('.signup-popup').on('click', function (e) {
        e.preventDefault()
        mobileMenu()
        setTimeout(function () {
            $('#signin').removeClass('show')
            $('#signup').addClass('show')
        }, 300)
    })
    $('.close-modal').on('click', function () {
        $('.authentication-content').removeClass('show')
    })

    /******************************************
    加载更多
    */
    var nextPage = document.querySelector('a[class=next]');
    var a = $(".load-more-posts");
    var b = $(".loadmore-section");
    if( nextPage !== null) {
        var nextPageUrl = nextPage.getAttribute('href');
    }
    if (!nextPage) {
        b.remove();
    }
    a.on('click',function (n) {
        n.preventDefault();
        if(place == 'index'){
                var i = nextPageUrl.split(/page/)[0] + "page/" + pagination_next_page_number + "/";
                }
                else{
               var i = window.location.href + pagination_next_page_number;    
                }
        
        $.ajax({
            url: i,
            beforeSend: function () {
                a.html(loadingText);
            },
        }).done(function (data) {
            var posts = $(".single-blog-post-card", data),
            postwrapper = $(".blog-post-masonary-card");
            postwrapper.append(posts).isotope("appended", posts);
            var $grid = $('.blog-post-masonary-card').imagesLoaded(function () {
                $grid.isotope({
                    itemSelector: '.single-blog-post-card',
                    percentPosition: true,
                    masonry: {
                        columnWidth: '.single-blog-post-card',
                    },
                })
            })
            a.text(moreArticle);
            pagination_next_page_number++;
            pagination_next_page_number > pagination_available_pages_number && b.remove();
        });
    });

    /******************************************
    实时搜索结果
    */
    var posts = [],
        searchKey = $('#search-input'),
        searchContent = $('#search-full-content'),
        searchResultnum = $('.no-result')
    // search-bar
    $('.search-bar').on('click', function (e) {
        e.preventDefault()
        $('.overlay-content')
            .addClass('active')
            $('body').addClass('body-overflow')
            searchKey.focus()


        if (posts.length == 0 && typeof searchContentApi !== undefined) {
            $.post(searchContentApi)
                .done(function(data) {
                    posts = data.posts
                    search()
                })
                .fail(function(err) {})
        }
    });

    
    //  关闭模块时清除input内容
    function searchEvent() {
        $('.overlay-content').removeClass('active')
        $('body').removeClass('body-overflow')
        searchKey.val('')
        searchContent.empty()
        searchResultnum.removeClass('d-block')
    }

    $('.bar-dismiss').on('click', function () {
        searchEvent()
    })
    $(document).keydown(function (event) {
        if (event.keyCode == 27) {
            searchEvent()
        }
    })

    function search(){
        var options = {
            shouldSort: true,
            tokenize: true,
            matchAllTokens: true,
            threshold: 0,
            location: 0,
            distance: 100,
            maxPatternLength: 32,
            minMatchCharLength: 1,
            keys: [{
              name: 'title',
              weight: 0.3
            }, {
              name: 'plaintext',
              weight: 0.7
            }]
          };
          var fuse = new Fuse(posts, options)
          
        searchKey.keyup(function(){
            var value = this.value,
            search = fuse.search(value),
            output = '',
            fadd = '',
            language = $('html').attr('lang')

            searchResultnum.addClass('d-block')
            searchResultnum.children('span').html(search.length)
            if(posts.length > 0){
            $.each(search, function(key, val) {
                    var pubDate = new Date(
                        val.published_at
                    ).toLocaleDateString(language, {
                        day: 'numeric',
                        month: 'long',
                        year: 'numeric',
                    })
                    output += `
                    <a class="single-search-result" href="${val.url}">
                        <div class="single-result-item">
                            <div class="search-content pr-sm-30">
                                <div class="d-flex mb-15 align-items-center">
                                    <h5 class="post-title">${val.title}</h5>     
                                </div> 
                                <p class="mb-0">${val.excerpt}</p>
                            </div>
                            <div class="prev-next-arrow d-none d-sm-block">
                                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-arrow-right"><line x1="5" y1="12" x2="19" y2="12"></line><polyline points="12 5 19 12 12 19"></polyline></svg>
                            </div>
                        </div>
                    </a>
                    `
                    
                });
                 fadd = `
                    <a class="single-search-result" href="?s=${value}">
                        <div class="single-result-item">
                            <div class="search-content pr-sm-30">
                                <div class="d-flex mb-15 align-items-center">
                                    <h5 class="post-title">没有找到您想要的结果？</h5>     
                                </div> 
                                <p class="mb-0">可以点击这里进行手动搜索</p>
                            </div>
                            <div class="prev-next-arrow d-none d-sm-block">
                                <svg xmlns="http://www.w3.org/2000/svg" width="24" height="24" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2" stroke-linecap="round" stroke-linejoin="round" class="feather feather-arrow-right"><line x1="5" y1="12" x2="19" y2="12"></line><polyline points="12 5 19 12 12 19"></polyline></svg>
                            </div>
                        </div>
                    </a>
                    `;
                searchContent.html(output+fadd)
            }
        })
    }
    

})